import React, { useState, useEffect } from 'react';
import {
  Box,
  Container,
  Typography,
  Button,
  CircularProgress,
  Paper,
  LinearProgress,
} from '@mui/material';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';
import { styled } from '@mui/material/styles';

const UploadContainer = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(4),
  textAlign: 'center',
  marginTop: theme.spacing(4),
  backgroundColor: 'rgba(255, 255, 255, 0.9)',
}));

const VideoContainer = styled(Paper)(({ theme }) => ({
  marginTop: theme.spacing(4),
  padding: theme.spacing(2),
  backgroundColor: 'rgba(255, 255, 255, 0.9)',
  width: '100%',
  maxWidth: '1600px',
  margin: '32px auto',
  '& video': {
    width: '100%',
    maxHeight: '70vh',
    objectFit: 'contain',
  }
}));

const ProcessingText = styled(Typography)(({ theme }) => ({
  marginTop: theme.spacing(2),
  color: theme.palette.text.secondary,
}));

const Account = () => {
  const [uploading, setUploading] = useState(false);
  const [processing, setProcessing] = useState(false);
  const [resultVideo, setResultVideo] = useState(null);
  const [progress, setProgress] = useState(0);

  useEffect(() => {
    let progressInterval;
    if (processing && progress < 100) {
      progressInterval = setInterval(() => {
        setProgress(currentProgress => {
          // Generate random increment between 1 and 20
          const randomIncrement = Math.floor(Math.random() * 20) + 1;
          // Calculate new progress
          const newProgress = Math.min(currentProgress + randomIncrement, 99);
          // If we're close to 10 seconds (based on interval), allow reaching 100
          if (currentProgress >= 95) {
            return 100;
          }
          return newProgress;
        });
      }, 1000); // Update every second

      // Force completion at exactly 10 seconds
      const finalTimer = setTimeout(() => {
        setProgress(100);
        setResultVideo('/result_out.mp4');
        setProcessing(false);
      }, 10000);

      return () => {
        clearInterval(progressInterval);
        clearTimeout(finalTimer);
      };
    }
  }, [processing]);

  const handleFileUpload = async (event) => {
    const file = event.target.files?.[0];
    if (!file) return;

    setUploading(true);
    setProgress(0);
    
    try {
      // First show uploading state
      await new Promise(resolve => setTimeout(resolve, 2000));
      setUploading(false);
      
      // Start processing with random progress
      setProcessing(true);
      
    } catch (error) {
      console.error('Error processing video:', error);
      setUploading(false);
      setProcessing(false);
    } finally {
      event.target.value = '';
    }
  };

  const getStatusText = () => {
    if (uploading) return "Uploading video...";
    if (processing) {
      if (progress < 30) return "Initializing processing...";
      if (progress < 60) return "Processing video...";
      if (progress < 90) return "Analyzing results...";
      return "Finalizing...";
    }
    return "Upload Video";
  };

  return (
    <Container maxWidth={false} sx={{ px: { xs: 2, sm: 4, md: 6, lg: 8 } }}>
      <Box sx={{ py: 8 }}>
        <Typography variant="h3" component="h1" gutterBottom textAlign="center">
          My Account
        </Typography>

        <UploadContainer elevation={3} sx={{ maxWidth: '800px', mx: 'auto' }}>
          <Typography variant="h5" gutterBottom>
            Upload Video for Processing
          </Typography>
          <input
            type="file"
            accept="video/mp4"
            onChange={handleFileUpload}
            style={{ display: 'none' }}
            id="video-upload"
          />
          <label htmlFor="video-upload">
            <Button
              component="span"
              variant="contained"
              size="large"
              disabled={uploading || processing}
              startIcon={(uploading || processing) ? <CircularProgress size={20} /> : <CloudUploadIcon />}
              sx={{ mt: 2 }}
            >
              {getStatusText()}
            </Button>
          </label>
          
          {(uploading || processing) && (
            <Box sx={{ width: '100%', mt: 3 }}>
              <LinearProgress 
                variant="determinate" 
                value={processing ? progress : 0} 
                sx={{ height: 8, borderRadius: 4 }}
              />
              <ProcessingText variant="body2">
                {processing ? `Progress: ${progress}%` : 'Uploading...'}
              </ProcessingText>
            </Box>
          )}
        </UploadContainer>

        {resultVideo && (
          <VideoContainer elevation={3}>
            <Typography variant="h6" gutterBottom sx={{ textAlign: 'center' }}>
              Processed Video Result
            </Typography>
            <Box sx={{ 
              width: '100%',
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              overflow: 'hidden'
            }}>
              <video
                controls
                src={resultVideo}
                style={{ 
                  borderRadius: '8px',
                  boxShadow: '0 4px 12px rgba(0,0,0,0.1)'
                }}
              >
                Your browser does not support the video tag.
              </video>
            </Box>
          </VideoContainer>
        )}
      </Box>
    </Container>
  );
};

export default Account;
